// Botpress Service Integration
export interface BotpressMessage {
  id: string;
  type: 'text' | 'image' | 'file' | 'card' | 'carousel' | 'quick_reply';
  text?: string;
  data?: any;
  timestamp: Date;
}

export interface BotpressConfig {
  botId: string;
  userId: string;
  conversationId?: string;
  configUrl: string;
  apiUrl?: string;
}

export class BotpressService {
  private config: BotpressConfig;
  private conversationId: string | null = null;
  private isConnected = false;
  private messageQueue: BotpressMessage[] = [];
  private messageListeners: ((message: BotpressMessage) => void)[] = [];

  constructor(config: BotpressConfig) {
    this.config = config;
    this.conversationId = config.conversationId || null;
  }

  // Initialize connection to Botpress
  async initialize(): Promise<void> {
    try {
      // Generate a unique conversation ID if not provided
      if (!this.conversationId) {
        this.conversationId = `conv_${Date.now()}_${Math.random().toString(36).substr(2, 9)}`;
      }

      // For now, we'll simulate a successful connection
      // In a real implementation, you would load the Botpress widget here
      this.isConnected = true;
      console.log('Botpress service initialized successfully (simulated)');
    } catch (error) {
      console.error('Failed to initialize Botpress service:', error);
      this.isConnected = false;
    }
  }

  // Send message to Botpress and get response
  async sendMessage(message: string): Promise<BotpressMessage[]> {
    try {
      if (!this.isConnected) {
        console.warn('Botpress not connected, using fallback');
        return this.getFallbackResponse(message);
      }

      // Simulate API call to Botpress
      console.log('Sending message to Botpress:', message);

      // Simulate network delay
      await new Promise(resolve => setTimeout(resolve, 1000 + Math.random() * 1000));

      // Return a contextual response based on the message
      return this.getContextualResponse(message);
    } catch (error) {
      console.error('Error sending message to Botpress:', error);
      return this.getFallbackResponse(message);
    }
  }

  // Get contextual response based on message content
  private getContextualResponse(message: string): BotpressMessage[] {
    const lowerMessage = message.toLowerCase();

    // Crisis-related responses
    if (lowerMessage.includes('suicide') || lowerMessage.includes('kill myself') || lowerMessage.includes('end it all')) {
      return [{
        id: `crisis_${Date.now()}`,
        type: 'text',
        text: "I'm really concerned about what you're sharing. Your safety is the most important thing right now. Please reach out to a crisis helpline immediately. In the US, you can call 988 for the Suicide & Crisis Lifeline. You're not alone, and there are people who want to help you.",
        timestamp: new Date()
      }];
    }

    // Depression-related responses
    if (lowerMessage.includes('depressed') || lowerMessage.includes('hopeless') || lowerMessage.includes('worthless')) {
      return [{
        id: `depression_${Date.now()}`,
        type: 'text',
        text: "I can hear that you're going through a really difficult time right now. It takes courage to share these feelings. While I'm here to listen and support you, I want to encourage you to also reach out to a mental health professional or trusted person in your life. You deserve support.",
        timestamp: new Date()
      }];
    }

    // Anxiety-related responses
    if (lowerMessage.includes('anxious') || lowerMessage.includes('worried') || lowerMessage.includes('panic')) {
      return [{
        id: `anxiety_${Date.now()}`,
        type: 'text',
        text: "I understand you're feeling anxious right now. These feelings are valid, and it's okay to not be okay sometimes. Let's work together to find some strategies that might help you feel a bit better. Would you like to try a breathing exercise or talk about what's on your mind?",
        timestamp: new Date()
      }];
    }

    // Stress-related responses
    if (lowerMessage.includes('stressed') || lowerMessage.includes('overwhelmed') || lowerMessage.includes('pressure')) {
      return [{
        id: `stress_${Date.now()}`,
        type: 'text',
        text: "I can hear that you're feeling overwhelmed right now. These feelings are valid, and it's okay to not be okay sometimes. Let's work together to find some strategies that might help you feel a bit better. Would you like to try a breathing exercise or talk about what's on your mind?",
        timestamp: new Date()
      }];
    }

    // Greeting responses
    if (lowerMessage.includes('hello') || lowerMessage.includes('hi') || lowerMessage.includes('hey')) {
      return [{
        id: `greeting_${Date.now()}`,
        type: 'text',
        text: "Hello! I'm Mira, your wellness guide. I'm here to listen and support you. How are you feeling today?",
        timestamp: new Date()
      }];
    }

    // General supportive responses
    const responses = [
      "I really appreciate you sharing that with me. It sounds like you're dealing with a lot right now.",
      "That sounds really challenging. I'm here to listen and support you through this.",
      "I can hear the strength in your words, even when things feel difficult. You're doing better than you might think.",
      "Thank you for trusting me with your thoughts. Let's work together to find some strategies that might help.",
      "I understand this is hard for you. Remember, it's okay to take things one step at a time.",
      "Your feelings are completely valid. Sometimes just talking about what's on our mind can help us feel a bit lighter.",
      "I'm glad you reached out. You're not alone in this, and I'm here to help you through it.",
      "That sounds really challenging. I want you to know that it's okay to not be okay sometimes."
    ];

    const randomResponse = responses[Math.floor(Math.random() * responses.length)];

    return [{
      id: `response_${Date.now()}`,
      type: 'text',
      text: randomResponse,
      timestamp: new Date()
    }];
  }

  // Fallback response when Botpress is unavailable
  private getFallbackResponse(message: string): BotpressMessage[] {
    const responses = [
      "I'm here to listen and support you. How are you feeling today?",
      "Thank you for sharing that with me. I understand this might be difficult to talk about.",
      "I'm glad you reached out. Let's work through this together, one step at a time.",
      "Your feelings are valid, and it's okay to not be okay sometimes. I'm here to help.",
      "I can hear that you're going through a challenging time. You're not alone in this."
    ];

    const randomResponse = responses[Math.floor(Math.random() * responses.length)];

    return [{
      id: `fallback_${Date.now()}`,
      type: 'text',
      text: randomResponse,
      timestamp: new Date()
    }];
  }

  // Get initial greeting message
  async getInitialGreeting(): Promise<BotpressMessage[]> {
    try {
      // Try to get a personalized greeting from Botpress
      const response = await this.sendMessage('start conversation');

      // If no response or empty, use default greeting
      if (response.length === 0 || !response[0].text) {
        return [{
          id: `greeting_${Date.now()}`,
          type: 'text',
          text: "Hello! I'm Mira, your wellness guide. I'm here to listen and support you. How are you feeling today?",
          timestamp: new Date()
        }];
      }

      return response;
    } catch (error) {
      console.warn('Failed to get Botpress greeting, using fallback:', error);
      return [{
        id: `greeting_${Date.now()}`,
        type: 'text',
        text: "Hello! I'm Mira, your wellness guide. I'm here to listen and support you. How are you feeling today?",
        timestamp: new Date()
      }];
    }
  }

  // Check if service is connected
  isServiceConnected(): boolean {
    return this.isConnected;
  }

  // Get conversation ID
  getConversationId(): string | null {
    return this.conversationId;
  }

  // Show/hide the Botpress widget (placeholder for future implementation)
  showWidget(): void {
    console.log('Botpress widget show (not implemented yet)');
  }

  hideWidget(): void {
    console.log('Botpress widget hide (not implemented yet)');
  }
}

// Create a singleton instance with your specific Botpress configuration
